def _partially_consume_prefix(self, prefix, column):
        lines = []
        current_line = ""
        current_column = 0
        for char in prefix:
            if char == '\t':
                current_column = (current_column + 8) // 8 * 8  # adjust for tabs
            elif char == ' ':
                current_column += 1
            elif char == '\n':
                lines.append(current_line + '\n')
                current_line = ""
                current_column = 0
            else:
                current_line += char

                if current_column < column:
                    continue
                else:
                    break

        lines.append(current_line)

        return ''.join(lines), prefix[len(''.join(lines)):]
